column14:
La estructura de dominio hace referencia exclusivamente a la vertiente de colaboración con la Seguridad Social, ingresos procedentes de las cuotas, y derechos, acciones y recursos relacionados con ellos, los cuales forman parte del patrimonio de la Seguridad Social para el desarrollo de las funciones que tiene atribuidas, bajo la dirección y tutela del Ministerio correspondiente.                                                           La Resolución de 11 de febrero de 2008, de la Secretaría de Estado de la Seguridad Social, autoriza la fusión de las Mutuas de Accidentes de Trabajo y Enfermedades Profesionales de la Seguridad Social, Reddis-Matt, MUPA y FIMAC.&#xD;
Con efectos de 1 de enero de 2008, se lleva a cabo la fusión de Mutua Reddis-Matt,  MUPA, y FIMAC, aprobando la denominación de Activa Mutua 2008. &#xD;
Actualización de la denominación de la Mutuas según el artículo 69 de la Ley 35/2014, de 26 de septiembre, por la que se modifica el Texto Refundido de la Ley General de la Seguridad Social. La denominación de las Mutuas incluirá "Mutua Colaboradora de la Seguridad Social" seguida del nº con el que haya sido inscrita.

La Entidad Pública Empresarial ADIF-Alta Velocidad se crea el 31 de diciembre de 2013, tras la aprobación del Real Decreto-ley 15/2013 sobre la reestructuración de la Entidad Pública Empresarial Administrador de Infraestructuras Ferroviarias (ADIF) y otras medidas urgentes en el orden económico.&#xD;
&#xD;
ADIF- Alta Velocidad se crea mediante la escisión de la rama de actividad de construcción y administración de las infraestructuras ferroviarias de alta velocidad de ADIF y otras que se le atribuyan y estén encomendadas hasta la fecha de entrada en vigor de dicho Real Decreto-ley, permaneciendo en ADIF la actividad de construcción y administración de las infraestructuras ferroviarias de la red convencional.&#xD;
&#xD;
A raíz de la entrada en vigor del mencionado Real Decreto-ley 15/2013, el 27 de diciembre se publica la Orden PRE/2443/2013, del Ministerio de la Presidencia, por la que se determinan los activos y pasivos de ADIF que pasan a ser titularidad de ADIF-Alta Velocidad. El artículo 2 del Real Decreto-ley 15/2013 y la Orden PRE/2443/2013 regulan la asignación a ADIF-Alta Velocidad de determinados bienes que constituían la Red de Titularidad del Estado, que fueron asignados a ADIF tras la entrada en vigor del Real Decreto-ley 4/2013, de 22 de febrero.

La entidad pública empresarial Administrador de Infraestructuras Ferroviarias (ADIF) fue creada por la Ley de Bases de 24 de enero de 1941, bajo la denominación de Red Nacional de los Ferrocarriles Españoles (RENFE).&#xD;
Con fecha 31 de diciembre de 2004 entró en vigor la Ley 39/2003, de 17 de noviembre, del Sector Ferroviario, que establece un nuevo marco para este sector y una completa reordenación del sector ferroviario estatal, sentando las bases que permiten una progresiva entrada de nuevos actores en este mercado. Para alcanzar estos objetivos, se reguló la administración de las infraestructuras ferroviarias y se encomendó esta función a RENFE, que pasaba a denominarse Administrador de Infraestructuras Ferroviarias, manteniendo su naturaleza jurídica de entidad pública empresarial e integrando, además, a la Entidad Pública Empresarial Gestor de Infraestructuras Ferroviarias. ADIF podía, según la citada ley, construir infraestructuras, de acuerdo con lo que determinase el Ministerio de Fomento, infraestructuras ferroviarias con cargo a sus propios recursos o mediante recursos ajenos. Asimismo, administraría las infraestructuras de su titularidad y aquellas otras cuya administración se le encomendase mediante un convenio. La Ley contemplaba, adicionalmente, la creación de una nueva entidad pública empresarial denominada RENFE Operadora, que se encargaría de la prestación del servicio de transporte ferroviario.&#xD;
El Real Decreto-ley 22/2012 de 20 de julio, por el que se adoptan medidas para la racionalización y reestructuración del sector ferroviario, incluye la extinción de la entidad pública empresarial Ferrocarriles Españoles de Vía Estrecha el 31 de diciembre de 2012, subrogándose ADIF y RENFE-Operadora en los derechos y obligaciones de aquélla, asumiendo la titularidad de los bienes en función de que se hallen adscritos a la infraestructura o a la operación de servicios de transporte respectivamente.&#xD;
El Real Decreto-ley 4/2013, de 22 de febrero, establece en su artículo 34 la transmisión a ADIF de la titularidad de la red ferroviaria del Estado cuya administración tiene encomendada.&#xD;
El Real Decreto-ley 15/2013 de 13 de diciembre, sobre la reestructuración de la entidad pública empresarial Administrador de Infraestructuras Ferroviarias (ADIF) y otras medidas urgentes en el orden económico determina en su artículo 1 que con fecha 31 de diciembre de 2013, se creará la entidad pública empresarial ADIF-Alta Velocidad mediante la escisión de la rama de actividad de construcción y administración de aquellas infraestructuras ferroviarias de alta velocidad y otras que se le atribuyan y estén encomendadas hasta la fecha de entrada en vigor de dicho Real Decreto-Ley al Administrador de Infraestructuras Ferroviarias (ADIF). La actividad no segregada permanece en ADIF.&#xD;
El Estatuto de ADIF fue aprobado mediante el Real Decreto 2395/2004, de 30 de diciembre, y ha modificado por el Real Decreto 1044/2013 de 27 de diciembre.

La Sociedad tiene su origen en la constitución, con fecha 13 de noviembre de 1991, de la sociedad Empresa de Mantenimiento Aeronáutico, S.A. Con fecha 16 de septiembre de 1999, se procede al cambio de denominación social a Emaer, Empresa Internacional de Infraestructuras, Mantenimiento y Servicios Aeronáuticos, S.A., manteniéndose el nombre comercial. Posteriormente, con fecha 25 de septiembre se procede al cambio de denominación social al de Aena Servicios Aeronáuticos, S.A., y con fecha 6 de julio de 2000, se inscribe en el Registro Mercantil un cambio de denominación social a Aena Desarrollo Internacional, S.A. y al actual nombre, Aena Desarrollo Internacional, S.M.E., S.A. con fecha 5 de septiembre de 2017, para adaptarse a lo establecido en el artículo 111.2 de la Ley 40/2015, de 1 de octubre, de Régimen Jurídico del Sector Público.&#xD;
Su actividad principal consiste en el desarrollo de la actividad internacional del Grupo Aena, al que pertenece la sociedad, a través de inversiones en sociedades domiciliadas fuera de España. Asimismo, la sociedad desarrolla actividades de servicio de verificación en vuelo de radioayudas a la navegación aérea y procedimientos de vuelo.&#xD;
Anea Desarrollo Internacional S.M.E., S.A. es dominante de un grupo de sociedades de acuerdo con la legislación vigente, si bien, está integrada en el Grupo AENA, cuya sociedad dominante es Aena.

