- Explotación, conservación, gestión y administración de infraestructuras aeroportuarias, así como los servicios complementarios a las mismas y los de asistencia a aeronaves, pasajeros, carga aérea y tripulaciones.&#xD;
- Planificación y elaboración de proyectos, dirección y control de ejecución de obras para infraestructuras e instalaciones aeroportuarias y de navegación aérea.&#xD;
- Construcción, ampliación, remodelación y equipamiento de infraestructuras aeroportuarias.&#xD;
- Realización de estudios, asesorías, ingenierías, consultorías, elaboración y evaluación de proyectos relacionados directamente con el negocio aeronáutico, aeroportuario y de navegación aérea.&#xD;
- Todas las demás actividades anejas y complementarias o relacionadas con las anteriores y en especial las referidas a las areas comerciales aeroportuarias.&#xD;
- También podrá realizar actividades de mantenimiento de aeronaves, equipos de aviónica y demás elementos.&#xD;
El objeto social podrá realizarse por la sociedad, directamente o indirectamente, participando en el capital de otras sociedades o entidades en el ámbito nacional e internacional. Asimismo y para la consecución del objeto social podrá promover y participar en cuantas formas de colaboración empresarial resulten admitidos en derecho.&#xD;

column14:
El Consejo de Ministros de 25 de febrero de 2011, autorizó la creación de la sociedad mercantil estatal Aena Aeropuertos, S.A.&#xD;
Tal y como estaba previsto en el Real Decreto Ley 13/2010, a la nueva sociedad se le atribuye el conjunto de funciones y obligaciones que estaba ejerciendo la entidad pública empresarial Aena en materia de gestión y explotación de los servicios aeroportuarios. &#xD;
Por Acuerdo de Consejo de Ministros de 3 de junio de 2011, se autorizó la aportación de los bienes integrantes del patrimonio aeroportuario de la entidad pública empresarial Aeropuertos Españoles y Navegación Aérea (AENA) a la sociedad estatal «Aena Aeropuertos, S.A.», y se acordó la ampliación de su capital, en los términos que resultan del Acuerdo del Consejo de Administración de AENA de 23 de mayo de 2011.&#xD;
Por Orden FOM/1525/2011, de 7 de junio, se acuerda el inicio del ejercicio efectivo de funciones y obligaciones en materia de gestión aeroportuaria por «Aena Aeropuertos, S.A.». Según establece su artículo 1.1 la sociedad mercantil estatal «Aena Aeropuertos, S.A.», comenzará a ejercer de manera efectiva su objeto social con efectos 8 de junio de 2011, fecha a partir de la cual la entidad pública empresarial Aeropuertos Españoles y Navegación Aérea (AENA) dejará de realizar la actividad de gestión aeroportuaria.&#xD;
Conforme a lo dispuesto en la Orden HAP/583/2012, de 20 de marzo, por la que se publica el ACM de 16 de marzo de 2012, por el que se aprueba el Plan de reestructuración y racionalización del sector público empresarial y fundacional, se lleva a cabo la fusión por absorción de Centros Logísticos Aeroportuarios, SA (CLASA) (sociedad absorbida) por parte de la Aena Aeropuertos, S.A. (sociedad  absorbente), quedando inscrita en el Registro con fecha 17/12/2012.&#xD;
Con entrada en vigor el 6/7/2014, el Real Decreto-ley 8/2014, de 4 de julio, de aprobación de medidas urgentes para el crecimiento, la competitividad y la eficiencia,en su artículo 18 establece el siguiente cambio de denominación:&#xD;
1. La sociedad mercantil estatal «Aena Aeropuertos, S.A.», creada en virtud de lo previsto en el artículo 7 del Real Decreto-ley 13/2010, de 3 de diciembre, de actuaciones en el ámbito fiscal, laboral y liberalizadoras para fomentar la inversión y la creación de empleo, pasa a denominarse Aena, S.A.&#xD;
2. La entidad pública empresarial Aeropuertos Españoles y Navegación Aérea (Aena), creada por el artículo 82 de la Ley 4/1990, de 29 de junio, de Presupuestos Generales del Estado para 1990, pasa a denominarse ENAIRE.&#xD;
ENAIRE continuará existiendo con la misma naturaleza y régimen jurídico previsto en el artículo 82 de la Ley 4/1990, de 29 de junio, y ejerciendo exclusivamente las competencias que actualmente ostenta en materia de navegación aérea y espacio aéreo y, además, la coordinación operativa nacional e internacional de la red nacional de gestión del tráfico aéreo y otras relacionadas con los usos para la gestión eficiente del espacio aéreo teniendo en cuenta las necesidades de los usuarios, y las funciones derivadas de su condición de medio propio instrumental y servicio técnico de la Administración General del Estado y de los poderes adjudicadores en materia de aeropuertos.&#xD;
Cambio en la denominación social con fecha 26/05/2017, según lo dispuesto en el artículo 111.2 de la Ley 40/2015, de 1 de octubre, de Régimen Jurídico del Sector Público, añadiendo a su denominación la abreviatura "S.M.E.".
